import Typography from "@material-ui/core";
import Box from "../components/Box";
import Header from "../components/Header";

export default function() {
  return (
    <>
      <Header />
      <Box color="#fff" bg="tomato">
        <Typography variant="h1">Tomato</Typography>
      </Box>
    </>
  );
}
